const int n = 41;
int find_x(double* values, double x, int l, int r){
    if(r-l>1){
        int mid = l+ ((r-l)/2);
        if(values[mid]==x){
            return mid;
        }
        else if(values[mid] < x){
            return find_x(values, x, mid, r);
        }
        else{
            return find_x(values, x, l, mid);
        }
    }
    else{
        if(x>values[r] || x<values[l]){
            return -1;
        }
        // cout<<x<<"\n";
        return l;
    }
}
// {x,y,val}
int find_y(double* values, double y, int l, int r){
    if(r-l>1){
        int mid = l+ ((r-l)/2);
        if(values[mid]==y){
            return mid;
        }
        else if(values[mid] < y){
            return find_y(values, y, mid, r);
        }
        else{
            return find_y(values, y, l, mid);
        }
    }
    else{
        // cout<<values[r]<<" "<<values[l]<<" "<<y<<"\n";
        if(y>values[r] || y<values[l]){
            return -1;
        }
        // cout<<x<<"\n";
        return l;
    }
}


double binary_search_interpolator_2D(double* values_x, double* values_y, double values_f[][n], double  x,double y, int n){
    int index_x = find_x(values_x,x,0,n-1);
    int index_y = find_y(values_y,y,0,n-1);
    if(index_x==-1 || index_y==-1){
        cout<<"cant find it\n";
        
        return -1;
    }
    if(values_x[index_x]==x && values_y[index_y]==y){
        return values_f[index_x][index_y];
    }
    else if(values_x[index_x]==x){
        return values_f[index_x][index_y] + (((y-values_y[index_y])*(values_f[index_x][index_y+1] - values_f[index_x][index_y]) )/(values_y[index_y+1] - values_y[index_y]));
    }
    else if(values_y[index_y]==y){
        return values_f[index_x][index_y] + (((x-values_x[index_x])*(values_f[index_x][index_y+1] - values_f[index_x][index_y]) )/(values_x[index_x+1] - values_x[index_x]));
    }
    else{
        // cout<<values_x[index_x+1]<<"\n";
        double term11 = (values_f[index_x][index_y]*((values_x[index_x+1] - x)*(values_y[index_y+1] - y)))   /((values_x[index_x+1] - values_x[index_x])*(values_y[index_y+1] - values_y[index_y]));
        double term21 = (values_f[index_x+1][index_y]*((x-values_x[index_x])*(values_y[index_y+1] - y)))   /((values_x[index_x+1] - values_x[index_x])*(values_y[index_y+1] - values_y[index_y]));
        double term12 = (values_f[index_x][index_y+1]*((values_x[index_x+1] - x)*(y - values_y[index_y])))   /((values_x[index_x+1] - values_x[index_x])*(values_y[index_y+1] - values_y[index_y]));
        double term22 = (values_f[index_x+1][index_y+1]*((x-values_x[index_x])*(y - values_y[index_y])))   /((values_x[index_x+1] - values_x[index_x])*(values_y[index_y+1] - values_y[index_y]));
        return term11+term21+term12+term22;
    }
}

